from typing import List, Optional
from collections import defaultdict

# Definition for a binary tree node.
# class TreeNode:
#     def __init__(self, val=0, left=None, right=None):
#         self.val = val
#         self.left = left
#         self.right = right

class TreeNode:
    def __init__(self, val, left=None, right=None):
        self.val = val
        self.left = left
        self.right = right
    def __repr__(self):
        return 'TreeNode({})'.format(self.val)

def deserialize(string):
    #print(f'\t>>> string = {string}')
    if string == '{}' or string == '[]':
        return None
    nodes = [None if val == 'null' else TreeNode(int(val))
             for val in string.strip('[]{}').split(',')]
    #print(f'\t>>> nodes = {nodes}')
    kids = nodes[::-1]
    #print(f'\t>>> kids = {kids}')
    root = kids.pop()
    #print(f'\t>>> root = {root}')
    for node in nodes:
        #print(f'\t\t>>> node = {node}')
        if node:
            if kids: node.left  = kids.pop()
            if kids: node.right = kids.pop()
    return root

class Solution:
    def replaceValueInTree(self, root: Optional[TreeNode]) -> Optional[TreeNode]:
        def dfs(node, depth):
            if depth not in self.hsh:
                self.hsh[depth] = dict()
                self.hsh1[depth] = 0
            if node:
                if node.left:
                    dfs(node.left, depth+1)
                self.hsh[depth][node] = (0 if not node.left else node.left.val) + (0 if not node.right else node.right.val)
                self.hsh1[depth] += self.hsh[depth][node]
                if node.right:
                    dfs(node.right, depth+1)
        def dfsUpdate(node, depth, parent):
            if node:
                if node.left:
                    dfsUpdate(node.left, depth+1, node)
                prev_depth = depth - 1
                if prev_depth not in self.hsh:
                    node.val = 0
                else:
                    node.val = self.hsh1[prev_depth] - self.hsh[prev_depth][parent]
                if node.right:
                    dfsUpdate(node.right, depth+1, node)
        self.hsh = dict()
        self.hsh1 = defaultdict(int)
        dfs(root, 1)
        #print(f'\tself.hsh = {self.hsh}')
        dfsUpdate(root, 1, None)
        return root

